import React, {useState} from 'react';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TablePagination from '@material-ui/core/TablePagination';
import Typography from '@material-ui/core/Typography';
import Paper from '@material-ui/core/Paper';
import { Grid, IconButton, Collapse, Box, Backdrop, CircularProgress, InputLabel } from '@material-ui/core';
import KeyboardArrowDownIcon from '@material-ui/icons/KeyboardArrowDown';
import KeyboardArrowUpIcon from '@material-ui/icons/KeyboardArrowUp';
import EditIcon from '@material-ui/icons/Edit';
import MenuBookIcon from '@material-ui/icons/MenuBook';
import { DarkTableCell, DarkTableRow, gridMessageError, BackdropLoading }  from '../customHooks/customComponents';
import { makeStyles } from '@material-ui/core/styles';
import { ButtonAdd } from '../customHooks/customComponents'

export const Presentational=({rows, setRows, clickAddUser, clickEditUser, loading})=>{
    return(
        <div>
        {BackdropLoading(loading)}
        <Grid container spacing={2}>
            <Grid item lg={12} md={12} sm={12} xs={12}>
                <Typography variant="h4">
                    Mantenimiento de Usuarios
                </Typography>
            </Grid>
            <Grid item lg={3} md={2} sm={1} xs={"auto"}></Grid>
            <Grid item lg={6} md={8} sm={10} xs={12}>
                <TableContainer component={Paper}>
                    <Table aria-label="collapsible table">
                        <TableHead>
                            <DarkTableRow>
                                <DarkTableCell />
                                <DarkTableCell>{"Nombre"}</DarkTableCell>
                                <DarkTableCell align="right">{"Apellido"}</DarkTableCell>
                                <DarkTableCell align="right">{"Email"}</DarkTableCell>
                                <DarkTableCell align="right">{"TelÃ©fono"}</DarkTableCell>
                                <DarkTableCell align="right">{"Rol"}</DarkTableCell>
                                <DarkTableCell />
                            </DarkTableRow>
                        </TableHead>
                        <TableBody>
                        {(rows &&
                        rows.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage).map((row) => (
                            <Row key={row.id} row={row} />
                        )))}
                        </TableBody>
                    
                    </Table>
                    <TablePagination
                        rowsPerPageOptions={[5, 10, 25]}
                        component="div"
                        count={rows ? rows.length : 0 }
                        rowsPerPage={rows ? rowsPerPage : 0}
                        page={page}
                        onChangePage={handleChangePage}
                        onChangeRowsPerPage={handleChangeRowsPerPage} />
                    </TableContainer>
            </Grid>
            <Grid item lg={3} md={2} sm={1} xs={"auto"}></Grid>
            </Grid>
            <button disabled={loading} onClick={clickAddUser}>Agregar usuario</button>
            <table>
                <thead>
                    <tr>
                        <th>Nombre</th>
                        <th>Apellido</th>
                        <th>Email</th>
                        <th>TelÃ©fono</th>
                        <th>Rol</th>
                        <th></th>
                    </tr>
                </thead>
                <tbody>
                    {(rows &&
                    rows.map((item, i) => {
                        return [
                            <tr key={i}>
                            <td>{item.first_name}</td>
                            <td>{item.last_name}</td>
                            <td>{item.email}</td>
                            <td>{item.phone}</td>
                            <td>
                            {
                                {
                                1: "Administrador",
                                2: "Bibliotecario",
                                3: "Lector",
                                }[item.profile_id]
                            }
                            </td>
                            <td><button onClick={()=>clickEditUser(item)}>Editar</button></td>
                            </tr>
                        ];
                    })
                    )}
                </tbody>
            </table>

        </div>
    )
}
